import logo from './logo.svg';
import './App.css';
import Registration from './modules/Registration';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </header>

      <Registration/>
    </div>
  );
}

export default App;
